import React from 'react'

import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const Index = (props) => {
    const useStyles = makeStyles({
        root: {
            background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
            border: 0,
            borderRadius: 3,
            boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
            color: 'white',
            height: 48,
            padding: '0 30px',
        },
    });

    return <Button onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} variant="contained" color="primary" style={{ "backgroundColor": "green" }} className={props.className + " " + classes.root}>{props.text}</Button>
}

export default Index;
